import { 
  DashboardOutlined, HomeOutlined, WalletOutlined, TeamOutlined, DeploymentUnitOutlined, BulbOutlined
} from '@ant-design/icons';
import { APP_PREFIX_PATH } from 'configs/AppConfig'

const dashBoardNavTree = [{
  key: 'Wallet',
  path: `${APP_PREFIX_PATH}/wallet`,
  title: 'Wallet',
  icon: WalletOutlined,
  breadcrumb: false,
  submenu: []
},
  {
  key: 'Userlist',
  path: `${APP_PREFIX_PATH}/userlist`,
  title: 'Userlist',
  icon: TeamOutlined,
  breadcrumb: false,
  submenu: []
},
  {
  key: 'Match',
  path: `${APP_PREFIX_PATH}/match`,
  title: 'Match',
  icon: TeamOutlined,
  breadcrumb: false,
  submenu: [
	    {
      key: 'Match',
      path: `${APP_PREFIX_PATH}/match/matchtab`,
      title: 'Match',
      icon: BulbOutlined,
      breadcrumb: true,
      submenu: [
        {
          key: 'Match List',
          path: `${APP_PREFIX_PATH}/match/matchtab/matchlist`,
          title: 'Match List',
          icon: '',
          breadcrumb: false,
          submenu: []
        },
        {
          key: 'My Match',
          path: `${APP_PREFIX_PATH}/match/matchtab/mymatch`,
          title: 'My Match',
          icon: '',
          breadcrumb: false,
          submenu: []
        }
      ]
    },

  ]
},						  

						 ]

const navigationConfig = [
  ...dashBoardNavTree
]

export default navigationConfig;
